import React from 'react';
import { Link } from 'react-router-dom';
import avatar from '../assets/User.png';
import { Toaster } from 'react-hot-toast';
import { useFormik } from 'formik';
import{ passwordValidate } from '../helper/validate'

import styles from '../styles/UserName.module.css';


export default function Password() {

    const formik = useFormik({
        initialValues : {
          password : ''
        },
        validate : passwordValidate,
        validateOnBlur: false,
        validateOnChange: false,
        onSubmit : async values => {
            console.log(values)
        }
    })

    return (
        <div className="container mx-auto">

            <Toaster position='top-center' reverseOrder={false}></Toaster>

            <div className='flex justify-center intems-center h-screen'>
                <div className={styles.glass}>
                    <div className="title flex flex-col items-center">
                        <h4 className='text-5xl fotn-bold'>Hello Again!</h4>
                        <span className='py-4 text-xl w-2/3 text-center text-gray-500'>
                            Explore More By Connecting with us.
                        </span>
                    </div>

                    <form className='py-1' onSubmit={formik.handleSubmit}>
                        <div className='profile flex justify-center py-4'>
                            <img src={avatar} className={styles.profile_img} alt="avatar" />
                        </div>

                <div className="textbox flex flex-col items-center gap-6">
                  <input {...formik.getFieldProps('password')} className={styles.textbox} type="text" placeholder='Password' />
                  <button className={styles.btn} type='submit'>Войти</button>
              </div>

                           <div className="text-center py-4">
                            <span className='text-gray-500'>Забыли пароль?<Link className='text-red-500' to='/recover'>восстановить пароль</Link></span>
                           </div>
                    </form>

                </div>
            </div>
        </div>
    )
}
